%[text] ## Data Acquisition and Preparation
%[text] ### Task 1.1: Importing Weather Data
%[text] - Using the 'readmatrix' function to import data \
% importing the weather data
data = readmatrix('Weather_Data.csv');

%Inspecting the data by displaying first few rows
head(data) %[output:457feb73]

% Checking for missing values
miss_val = sum(ismissing(data));
disp(miss_val) %[output:74cec4dc]

% Data seems to contains datetime and
% categorical values, 
% we would use use readtimetable
% instead of readmatrix

%[text] - Using the 'readtimetable' instead of 'readmatrix' function to import data \

% Setting up the Import Options Object for importing delimited text files
opts = delimitedTextImportOptions("NumVariables", 8);
% 'NumVariables',8 argument indicates that the file contains 8 columns

% Specifying range of imported data and delimiter used in the file
opts.DataLines = [2, Inf];
% Range of imported data starts from 2nd line to the end
opts.Delimiter = ",";

% Specify column names and types
opts.VariableNames = ["Date_Time", "Temp_C", "DewPointTemp_C", "RelHum__", "WindSpeed_km_h", "Visibility_km", "Press_kPa", "Weather"];
opts.VariableTypes = ["datetime", "double", "double", "double", "double", "double", "double", "categorical"];

% Specify file level properties
opts.ExtraColumnsRule = "ignore";
% Ignoring any extra columns that are not specified
opts.EmptyLineRule = "read";
% Reading empty lines as they are

% Specify variable properties
opts = setvaropts(opts, "Weather", "EmptyFieldRule", "auto");
opts = setvaropts(opts, "Date_Time", "InputFormat", "MM/dd/yyyy HH:mm", "DatetimeFormat", "preserveinput");
% Setting additional properties for specific variables

% Import the data
Weather_Data = readtimetable("C:\Users\Dell\Downloads\Weather_Data.csv", opts, "RowTimes", "Date_Time");

% Clear temporary variables
clear opts

% Display results
Weather_Data %[output:4c53c3ee]
%[text] - Inspecting Data \
% Displaying the first few rows of the data
head(Weather_Data) %[output:99567cd3]

% Checking for missing values
missing_values = sum(ismissing(Weather_Data));
disp('Missing Values in Each Column: ') %[output:7081acad]
disp(missing_values) %[output:669e29d9]
%[text] ### Task 1.2: Organizing the data into appropriate MATLAB data structures
%[text] - Using tables or matrices to store and manipulate the data. \
% Converting to table for easier manipulation
weather_data = timetable2table(Weather_Data) %[output:0beda30a]
%[text] - Extracting relevant columns for analysis. \
temperature = weather_data.Temp_C;
humidity = weather_data.RelHum__;
wind_speed = weather_data.WindSpeed_km_h;
visibility = weather_data.Visibility_km;
%[text] ## Basic Data Analysis:
%[text] ### **Task** **2.1:** Calculating the basic statistical measures for each weather parameter (mean, median, standard deviation).
%[text] - Using built-in MATLAB functions for statistical analysis \
% For Temperature
mean_temp = mean(temperature);
median_temp = median(temperature);
std_temp = std(temperature);

% For Humidity
mean_humidity = mean(humidity);
median_humidity = median(humidity);
std_humidity = std(humidity);

% For Windspeed
mean_windspeed = mean(wind_speed);
median_windspeed = median(wind_speed);
std_windspeed = std(wind_speed);

% For Visibility
mean_visibility = mean(visibility);
median_visibility = median(visibility);
std_visibility = std(visibility);
%[text] ### **Task** **2.2:** Identify trends and patterns in the data.
%[text] - Plotting time series graphs \
dates = weather_data.Date_Time;

% for Temperature
figure;
subplot(4,1,1);
plot(dates,temperature);
title('Temperature Over Time');
xlabel('Date');
ylabel('Temperature (deg C) ');

% for Humidity
subplot(4,1,2);
plot(dates,humidity);
title('Humidity Over Time');
xlabel('Date');
ylabel('Humidity (%)');

% for Wind Speed
subplot(4,1,3);
plot(dates,wind_speed);
title('Wind Speed Over Time');
xlabel('Date');
ylabel('Wind Speed (km/hr)');

% for Visibility
subplot(4,1,4);
plot(dates,visibility);
title('Visibility Over Time');
xlabel('Date');
ylabel('Visibility (km)');

%[text] - Use moving averages to smooth the data and highlight trends. \
% Considering 7-day moving average
% For each point in the data, the average of the surrounding
% 7 days (including the current days) will be calculated.

window_size = 7;

% Calculating the moving average using specified window size.
temp_smooth = movmean(temperature, window_size);
% where each element is the average of the surrounding
% 7 elements in the original data
hum_smooth = movmean(humidity, window_size);
wind_smooth = movmean(wind_speed, window_size);
vis_smooth = movmean(visibility, window_size);

% Plotting the graph with smoothed data
% for Temperature
figure;
subplot(4,1,1);
plot(dates,temp_smooth);
title('Smooth Temperature Over Time');
xlabel('Date');
ylabel('Temperature (deg C) ');

% for Humidity
subplot(4,1,2);
plot(dates,hum_smooth);
title('Smooth Humidity Over Time');
xlabel('Date');
ylabel('Humidity (%)');

% for Wind Speed
subplot(4,1,3);
plot(dates,wind_smooth);
title('Smooth Wind Speed Over Time');
xlabel('Date');
ylabel('Wind Speed (km/hr)');

% for Visibility
subplot(4,1,4);
plot(dates,vis_smooth);
title('Smooth Visibility Over Time');
xlabel('Date');
ylabel('Visibility (km)');
%[text] ## Advanced Data Analysis:
%[text] ### **Task** **3.1:** Perform correlation analysis between differentweather parameters.
%[text] - Calculate correlation coefficients and create scatterplots to visualize relationships. \
% Calculating Correlation Coefficients
corr_temp_humidity = corr(temperature,humidity) %[output:1f323fb5]
corr_temp_windspeed = corr(temperature,wind_speed) %[output:71ad8219]
corr_temp_visibility = corr(temperature,visibility) %[output:8f090c2e]

% Creating Scatterplots to visualize relationships
figure;
subplot(3,1,1);
scatter(temperature,humidity);
title('Temperature vs Humidity');
xlabel('Temperature (deg C)');
ylabel('Humidity (%)');

subplot(3,1,2);
scatter(temperature,wind_speed);
title('Temperature vs Wind Speed');
xlabel('Temperature (deg C)');
ylabel('Wind Speed (km/hr)');

subplot(3,1,3);
scatter(temperature,visibility);
title('Temperature vs Visibility');
xlabel('Temperature (deg C)');
ylabel('Visibility (km)');
%[text] ### **Task 3.2:** Implement linearregression to modelthe relationship between temperature and other weather parameters.
%[text] - Use the polyfitand polyval functionsto fit and evaluate the regression model. \
% fitting and evaluating the regression model
p_temp_humidity = polyfit(temperature,humidity,1);
% where 1 is the degree of polynomial fit
p_temp_windspeed = polyfit(temperature,wind_speed,1);
p_temp_visibility = polyfit(temperature,visibility,1);

humidity_fit = polyval(p_temp_humidity,temperature);
windspeed_fit = polyval(p_temp_windspeed,temperature);
visibility_fit = polyval(p_temp_visibility,temperature);
%[text] - Plot the regression line and analyze the results. \
figure;
% For Temp and Humidity
subplot(3,1,1);
scatter(temperature,humidity);
hold on;
plot(temperature,humidity_fit,'r');
title('Temperature vs Humidity with Regression Line');
xlabel('Temperature (deg C)');
ylabel ('Humidity (%)');

% For Temp and Wind Speed
subplot(3,1,2);
scatter(temperature,wind_speed);
hold on;
plot(temperature,windspeed_fit,'r');
title('Temperature vs Wind Speed with Regression Line');
xlabel('Temperature (deg C)');
ylabel ('Wind Speed (km/hr)');

% For Temp and Visibility
subplot(3,1,3);
scatter(temperature,visibility);
hold on;
plot(temperature,visibility_fit,'r');
title('Temperature vs Visibility with Regression Line');
xlabel('Temperature (deg C)');
ylabel ('Visibility (km)');

hold off
%[text] ## Data Visualization:
%[text] ### **Task** **4.1:** Create comprehensive visualizations to present the analysis.
%[text] - Use subplot to create multipleplots in a single figure. \
% for Temperature
figure;
subplot(4,1,1);
plot(dates,temperature);
title('Temperature Over Time');
xlabel('Date');
ylabel('Temperature (deg C) ');

% for Humidity
subplot(4,1,2);
plot(dates,humidity);
title('Humidity Over Time');
xlabel('Date');
ylabel('Humidity (%)');

% for Wind Speed
subplot(4,1,3);
plot(dates,wind_speed);
title('Wind Speed Over Time');
xlabel('Date');
ylabel('Wind Speed (km/hr)');

% for Visibility
subplot(4,1,4);
plot(dates,visibility);
title('Visibility Over Time');
xlabel('Date');
ylabel('Visibility (km)');
%[text] - Customize plots with titles, labels,legends, and annotations. \
% for Temperature
figure; %[output:345be842]

plot(dates,temperature,'r--o'); %[output:345be842]
title('Temperature Over Time'); %[output:345be842]
xlabel('Date'); %[output:345be842]
ylabel('Temperature (deg C) '); %[output:345be842]
legend('Temperature'); %[output:345be842]

% for Humidity
plot(dates,humidity,'b--o'); %[output:21ac0597]
title('Humidity Over Time'); %[output:21ac0597]
xlabel('Date'); %[output:21ac0597]
ylabel('Humidity (%)'); %[output:21ac0597]
legend('Humidity'); %[output:21ac0597]

% for Wind Speed
plot(dates,wind_speed,'y--o'); %[output:6d89ce91]
title('Wind Speed Over Time'); %[output:6d89ce91]
xlabel('Date'); %[output:6d89ce91]
ylabel('Wind Speed (km/hr)'); %[output:6d89ce91]
legend('Wind Speed'); %[output:6d89ce91]

% for Visibility
plot(dates,visibility,'r-.*'); %[output:731ff8b6]
title('Visibility Over Time'); %[output:731ff8b6]
xlabel('Date'); %[output:731ff8b6]
ylabel('Visibility (km)'); %[output:731ff8b6]
legend('Visibility'); %[output:731ff8b6]
%[text] ### **Task 4.2:** Develop 3D surface plots to visualize temperature variation over time and space.
%[text] - Use the surf and mesh functions to create 3D plots. \
%%
% Clearing memory
clear dates;
clear hum_smooth;
clear hum_smooth;
clear temp_smooth;
clear visibility_fit;
clear vis_smooth;
clear Weather_Data;
clear windspeed_fit;
clear wind_smooth;
%%

% Assuming weatherTable.Date and temperature are vectors of the same length
% Converting DateTime to numeric values for plotting
time = datetime(weather_data.Date_Time);

% Creating an artificial index for the Y-axis
index = 1:length(temperature); % Create an index for each temperature value

% Creating the grid
[X, Y] = meshgrid(time, index);

% Reshaping temperature into a matrix
Z = repmat(temperature', length(index), 1);

% Creating the 3D surface plot
surf(X, Y, Z); %[output:469d7c7b]
title('3D Surface Plot of Temperature'); %[output:469d7c7b]
xlabel('DateTime'); %[output:469d7c7b]
ylabel('Index'); %[output:469d7c7b]
zlabel('Temperature'); %[output:469d7c7b]

% Formatting  the DateTime axis
xtickformat('dd/MM/yyyy HH:mm'); %[output:469d7c7b]
% Adding this command to prevent serialization error
uicontrol('Visible', 'off');ps %[output:469d7c7b]
